import React from 'react';
import ReactDOM from 'react-dom';
import Login from './pages/login.js';

class App extends React.Component {

    render() {
        let login_page = Login();

        return (
            login_page
        );
    }
}

ReactDOM.render(
    <App />, 
    document.querySelector('#root')
);
